import React from 'react';
import {TextField, Button, Switch, FormControlLabel} from '@material-ui/core';

function FormularioCadastro(){
    return(
        <form>
            <TextField id="nome" label="Nome" variant="outlined"  fullWidth margin="normal" />

            <TextField id="sobrenome" label="Sobrenome" variant="outlined" fullWidth margin="normal"/>

            <TextField id="cpf" label="CPF" variant="outlined" fullWidth margin="normal"/>

            <FormControlLabel label="Promoções"
                control={
                <Switch
                    defaultChecked
                    name="promocoes"
                    color="primary"
                />
                }
            />

            <FormControlLabel label="Novidades"
                control={
                <Switch
                    defaultChecked
                    name="novidades"
                    color="primary"
                />
                }
            />

            <Button type="submit" variant="contained" color="primary">
                Cadastrar
            </Button>
        </form>
    );
}

export default FormularioCadastro;
